column41:
As discussed in today's meeting, creating this tracking defect for SOHO Salutation issue.

While placing order from Omnius front end, Agent is capturing Mr or Mrs values as salutation along with Customer Name & Company Name in customer data section and same has been sent to OGW in submit order request.
{code:java}
<Type>SOHO</Type> <CustomerSubType>PRIVATE</CustomerSubType> <CustomerPassword/> <PrivateCustomerInfo> <Salutation>R</Salutation> <SalutationC1Key/> <Title>Dr.</Title> <TitleC1Key/> <FirstName>Ajay</FirstName> <LastName>Order</LastName> <Nationality/> <IdentificationCardNumber/> <BirthDate/> <EmailAddress>ajay.bhavar@vodafone.com</EmailAddress> </PrivateCustomerInfo> <CompanyDetails> <Name>OSF Test</Name> <RegistrationNumber/> <RegistrationCity/> <RegistrationType/> <EmailAddress>ajay.bhavar@vodafone.com</EmailAddress> <PhoneList> <Phone> <CountryCode>0049</CountryCode> <AreaCode>0211</AreaCode> <PhoneNumber>124678</PhoneNumber> <Type>FIXED_PHONE</Type> </Phone> </PhoneList> <ContactPersonFirstName>Ajay</ContactPersonFirstName> <ContactPersonLastName>Order</ContactPersonLastName> </CompanyDetails>Â {code}
But when OGW is sending Activation Request (Json Request) towards Cable backend (VKD), It's not sending Salutation in input request.
{code:java}
<ROOT type='java.lang.String'>{"orderProperties":{"orderEntryId":"1091865","unifiedOrderId":"2848083","signDate":"2024-07-10"},"orderMarketingInfo":{"advertisingCode":"INB","optIn":{"telMarketingFlag":false,"insertFlag":false,"mailMarketingFlag":false,"advertisingFlag":false},"marketingCode":"BRI","campaignCode":"MGM"},"serviceAddress":{"apartmentDetails":{"technicianNeeded":false},"addressId":"1259435"},"consumer":{"portal":"OFT","authentication":{"agent":{"creator":"shweta.bijwe1","salesId":"99834","agentVpkn":"VA177001"}}},"customer":{"customerAddress":{"addressId":"1259435"},"deliveryAddress":{"address":{"addressId":"1259435"},"person":{"legalPerson":{"contactPerson":"Order, Ajay","company":"OSF Test"}}},"person":{"emailAddress":ajay.bhavar@vodafone.com,"legalPerson":{"contactPerson":"Order, Ajay","company":"OSF Test"},"phoneNumbers":[{"areaCode":"0211","callNumber":"124678","phoneNumberType":"WORK_PHONE"}]}},"orderCart":{"billingAddress":{"address":{"addressId":"1259435"},"person":{"legalPerson":{"contactPerson":"Order, Ajay","company":"OSF Test"}}},"debitInfo":{"billingType":"ONLINE","iban":"DE60100700240928226000","paymentMethod":"COLLECTION","mandateMethod":"EXISTING","instituteName":"Deutsche Bank","swift":"DEUTDEDBBER"},"serviceLines":[{"processContext":"ACQ","category":"KIP","orderLineId":"1002269852","serviceLineId":"NEW","products":[{"productId":"0B6","action":"ADD"},{"productId":"1BV:B09","action":"ADD"},{"productId":"1K6","action":"ADD"},{"productId":"9I0:B00","action":"ADD"},{"productId":"AO0","action":"ADD"},{"productId":"FM4:B00","action":"ADD"},{"productId":"HO1:000","action":"ADD"},{"productId":"OF5:B00","action":"ADD"},{"productId":"PC1:B01","action":"ADD"},{"productId":"TOEVN","action":"ADD"},{"productId":"TOTBN","action":"ADD"},{"productId":"TOVDS","action":"ADD"},{"productId":"VKP","action":"ADD"},{"productId":"VSA:N24","action":"ADD"},{"productId":"WTXN21","action":"ADD"}]}]}}</ROOT>{code}
Due to this issue, VKD system is adding FIRMA as a salutation for this request in backend but When customer is activated in backend and agent tries to perform in-life sales flow on same customer, Omnius asking to select value for salutation field.

As discussed - Omnius is having only Mr & Mrs values for Cable SOHO customer in checkout & VKD backend is having only FIRMA value for salutation in backend for Legal customer.

